  false,\n\t\"url\": null,\n\t\"notes\": \"Data and information collected by the submersible
  Johnson Sea-Link I along its track during nineteen dives of the 2005 \"Life on the
  Edge\" expedition sponsored by the National Oceanic and Atmospheric Administration
  (NOAA) Office of Ocean Exploration, October 16 through November 4, 2005. Measurements
  and information include sub's position, altitude, and depth; personnel assignments;
  dive, mission, and vehicle ID's; and sound velocity measurements. The Marine Operations
  Division of the Harbor Branch Oceanographic Institution provided the original submersible
  data.\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
